                        <p>{post.goodsUnitOfMeasurement}</p>
                        <p>{post.availableStock}</p>
                        <p>{post.qtySold}</p>
                        <p>{post.goodsStatus}</p>
                    </li>
                ))}
            </ul>
      </div>
    </div>;
  };

